     "introduced", 
     "Providing for consideration of the joint resolution (H.J. Res. 70) making continuing appropriations for National Park Service operations, the Smithsonian Institution, the National Gallery of Art, and the United States Holocaust Memorial Museum for fiscal year 2014, and for other purposes; providing for consideration of the joint resolution (H.J. Res. 71) making continuing appropriations of local funds of the District of Columbia for fiscal year 2014; providing for consideration of the joint resolution (H.J. Res. 72) making continuing appropriations for veterans benefits for fiscal year 2014, and for other purposes; providing for consideration of the joint resolution (H.J. Res. 73) making continuing appropriations for the National Institutes of Health for fiscal year 2014, and for other purposes; providing for consideration of the bill (H.R. 3230) making continuing appropriations during a Government shutdown to provide pay and allowances to members of the reserve components of the Armed Forces who perform inactive-duty training during such period; and providing for consideration of motions to suspend the rules."
