   "title_without_number": "Providing for consideration of the bill (H.R. 687) to facilitate the efficient extraction of mineral resources in southeast Arizona by authorizing and directing an exchange of Federal and non-Federal land, and for other purposes; providing for consideration of the bill (H.R. 1526) to restore employment and educational opportunities in, and improve the economic stability of, counties containing National Forest System land, while also reducing Forest Service management costs, by ensuring that such counties have a dependable source of revenue from National Forest System land, to provide a temporary extension of the Secure Rural Schools and Community Self-Determination Act of 2000, and for other purposes; providing for consideration of the bill (H.R. 3102) to amend the Food and Nutrition Act 2008; and for other purposes.", 
